import styled from 'styled-components';

export const Container = styled.div`

    background-color: #F3F1F1;
    width: 100%;


.productList{
    width: calc(100% + 15px);
    display: grid;
    grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
    grid-gap: 24px;
    row-gap: 24px;
    list-style: none;
    padding-right: 10px;
}

.productItem{
    display: inline-grid;
}
`;
